// BookingDetails.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const BookingDetails = ({ match }) => {
  const [booking, setBooking] = useState({});

  useEffect(() => {
    axios.get(`http://localhost:8000/api/bookings/${match.params.id}`)
      .then(response => {
        setBooking(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, [match.params.id]);

  return (
    <div>
      <h2>Booking Details</h2>
      <p>Event: {booking.event}</p>
      <p>Ticket Quantity: {booking.ticket_quantity}</p>
      <p>Total Cost: {booking.total_cost}</p>
    </div>
  );
};

export default BookingDetails;
